import React from 'react';
import kws from '../images/clients/ebaylogo.png';
import geps from '../images/clients/amazon.png';
import protergia from '../images/clients/protergia.png';

const clientImage = {
    height: '10rem',
    width: 'auto',
    mixBlendMode: 'colorBurn'
}

const Clients = () => {
    return (
        <div className="mt-8 bg-gray-100">
            <section data-aos="fade-up">
                <div className="my-4 py-4">
                    <h2 className="my-2 text-center text-3xl text-blue-900 uppercase font-bold">Our Clients</h2>
                    <div className='flex justify-center'>
                        <div className='w-24 border-b-4 border-blue-900'></div>
                    </div>
                    <h2 className="mt-4 mx-12 text-center text-xl lg:text-2xl font-semibold text-blue-900">Some of our clients.</h2>
                </div>
            </section>

            <div className="p-16" data-aos="fade-in" data-aos-delay="600">
                <div className="flex justify-center"> {/* Centering the grid */}
                    <div className="grid sm:grid-cols-3 lg:grid-cols-3">
                        <div className="flex justify-center items-center transition-all ease-in-out opacity-50 hover:opacity-100 w-1/3">
                            <img src={kws} alt="client" style={{ maxWidth: '100%', maxHeight: '100%' }} />
                        </div>

                        <div className="flex justify-center items-center transition-all ease-in-out opacity-50 hover:opacity-100 w-1/3">
                            <img src={geps} alt="client" style={{ maxWidth: '100%', maxHeight: '100%' }} />
                        </div>

                        {/* Add more similar divs for other images */}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Clients;
